Rocco has just opened a store which sells copy machines, and he's taking it pretty seriously. So much so that he's insisting that his only employee Lyla, and himself, really dress up, which she thinks is kind of silly. Come on she says, they're selling copy machines to convenience stores and other small business's, and he thinks they should be dressing to impress. Confronting him about this, she suggests he loosen up a little, take his tie off, and simply enjoy the small business he has more casually. In fact, she thinks he should really loosen up, and have sex with her in the store on opening day. He's horrified, but before he can make a real argument she's got his tie off, his pants down, and is showing him how great a casual work environment can be.
